package com.patterns;

public class Pattern4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
			// TODO Auto-generated method stub
			int k=0;
			int l=1;
			for(int i=0;i<5;++i)
			{
				for(int j=0;j<5;++j)
				{
					
					if(l==1)
					{
					System.out.print(l+" ");//1
					++l;
					}
					
					if(k!=0)
					if(k<=100)
					System.out.print(k+" ");//5
					k=k+5;

				}
				System.out.println();
			}
				}

			}

		